import { newStoriesURL } from "./apiEndPoints";
import axios from "axios";

export const getNewStoryIds = () => {
    return axios
        .get(newStoriesURL)
        .then((res) => {
            console.log(res);
            console.log(res.data);
            const { results } = res.data;
            console.log(results);
            return results;
        })
        .catch((err) => {
            console.log(err);
        });
};
